import React, { Component } from 'react';

import {
  Wrapper,
} from '../../../styled-components/player-modal.styled-components';

export default class Player extends Component {
  constructor(props) {
    super(props);
    this.state = {
      player: '',
    };
  }

  render() {
    return (
      <>
        <Wrapper>
          <div className="container">
            <div className="row">
              <div className="col-12">
                <h1>Player Name</h1>
              </div>
            </div>
          </div>
        </Wrapper>
      </>
    );
  }
}
